import "../../style/Main.css";
import { Link } from "react-router-dom";

function Card({ id, title, cover }) {
  return (
    <Link key={id} to={`/projet-8/Annonces/${id}`}>
      <article className="cardAnnonce" style={`background: url:${cover}`}>
        <h4>{title}</h4>
      </article>
    </Link>
  );
}
export default Card;
